oFF.UiRemoteUtils = {

	ADD_OP_NAME:"add",
	ASSOCIATION_PREFIX:"Association.",
	CLEAR_OP_NAME:"clear",
	REMOVE_OP_NAME:"remove",
	SET_OP_NAME:"set",
	_validateAssociation:function(associationDef)
	{
			if (oFF.isNull(associationDef))
		{
			throw oFF.XException.createRuntimeException("Missing association! Cannot generate remote operation name!");
		}
		return true;
	},
	deserializeStringList:function(serializedListString)
	{
			if (oFF.notNull(serializedListString))
		{
			let stringList = oFF.XList.create();
			let tmpElement = oFF.PrUtils.deserialize(serializedListString);
			if (oFF.notNull(tmpElement) && tmpElement.isList())
			{
				let tmpList = tmpElement.asList();
				oFF.XCollectionUtils.forEach(tmpList.getValuesAsReadOnlyList(), (element) => {
					if (element.isString())
					{
						stringList.add(element.asString().getString());
					}
				});
			}
			return stringList;
		}
		return null;
	},
	generateAssociationAddOperationName:function(associationDef)
	{
			if (oFF.UiRemoteUtils._validateAssociation(associationDef))
		{
			return oFF.XStringUtils.concatenate4(oFF.UiRemoteUtils.ASSOCIATION_PREFIX, associationDef.getName(), ".", oFF.UiRemoteUtils.ADD_OP_NAME);
		}
		return null;
	},
	generateAssociationClearOperationName:function(associationDef)
	{
			if (oFF.UiRemoteUtils._validateAssociation(associationDef))
		{
			return oFF.XStringUtils.concatenate4(oFF.UiRemoteUtils.ASSOCIATION_PREFIX, associationDef.getName(), ".", oFF.UiRemoteUtils.CLEAR_OP_NAME);
		}
		return null;
	},
	generateAssociationRemoveOperationName:function(associationDef)
	{
			if (oFF.UiRemoteUtils._validateAssociation(associationDef))
		{
			return oFF.XStringUtils.concatenate4(oFF.UiRemoteUtils.ASSOCIATION_PREFIX, associationDef.getName(), ".", oFF.UiRemoteUtils.REMOVE_OP_NAME);
		}
		return null;
	},
	generateAssociationSetOperationName:function(associationDef)
	{
			if (oFF.UiRemoteUtils._validateAssociation(associationDef))
		{
			return oFF.XStringUtils.concatenate4(oFF.UiRemoteUtils.ASSOCIATION_PREFIX, associationDef.getName(), ".", oFF.UiRemoteUtils.SET_OP_NAME);
		}
		return null;
	},
	serializeStringList:function(stringList)
	{
			let stringifiedList = null;
		if (oFF.notNull(stringList))
		{
			let tmpList = oFF.PrFactory.createList();
			tmpList.addAllStrings(stringList);
			stringifiedList = oFF.PrUtils.serialize(tmpList, false, false, 0);
		}
		return stringifiedList;
	}
};

