oFF.UiMethodSignatureGenerator.create = function(returnTypeStr, methodName, javaDocDesc, returnJavaDocStr)
{
	let newInstance = new oFF.UiMethodSignatureGenerator();
	newInstance.setupMethodDef(returnTypeStr, methodName, javaDocDesc, returnJavaDocStr);
	return newInstance;
};
oFF.UiMethodSignatureGenerator.prototype.m_javaDocDesc = null;
oFF.UiMethodSignatureGenerator.prototype.m_methodName = null;
oFF.UiMethodSignatureGenerator.prototype.m_outputBuffer = null;
oFF.UiMethodSignatureGenerator.prototype.m_paramJavaDocList = null;
oFF.UiMethodSignatureGenerator.prototype.m_paramStrMap = null;
oFF.UiMethodSignatureGenerator.prototype.m_returnJavaDocStr = null;
oFF.UiMethodSignatureGenerator.prototype.m_returnType = null;
oFF.UiMethodSignatureGenerator.prototype.addMethodParam = function(name, typeStr, javaDocStr)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(name) && oFF.XStringUtils.isNotNullAndNotEmpty(typeStr))
	{
		let paramJavaDocStr = oFF.XStringUtils.concatenate4(" * @param ", name, " ", javaDocStr);
		this.m_paramJavaDocList.add(paramJavaDocStr);
		let paramStr = oFF.XStringUtils.concatenate3(typeStr, " ", name);
		this.m_paramStrMap.put(name, paramStr);
	}
};
oFF.UiMethodSignatureGenerator.prototype.generate = function(generateLanguageHint)
{
	this.m_outputBuffer.clear();
	let javaDocDescStr = oFF.XStringUtils.concatenate2(" * ", this.m_javaDocDesc);
	let returnJavaDocStr = null;
	if (!oFF.XString.isEqual(this.m_returnType, "void"))
	{
		returnJavaDocStr = oFF.XStringUtils.concatenate2(" * @return ", this.m_returnJavaDocStr);
	}
	let paramStr = null;
	if (this.m_paramStrMap.size() > 0)
	{
		paramStr = " ";
		let paramStrsList = oFF.XCollectionUtils.getStringMapValuesSorted(this.m_paramStrMap);
		for (let a = 0; a < paramStrsList.size(); a++)
		{
			let tmpParamStr = paramStrsList.get(a);
			paramStr = oFF.XStringUtils.concatenate2(paramStr, tmpParamStr);
			if (a + 1 !== paramStrsList.size())
			{
				paramStr = oFF.XStringUtils.concatenate2(paramStr, ", ");
			}
		}
		paramStr = oFF.XStringUtils.concatenate2(paramStr, " ");
	}
	let methodStr = oFF.XStringUtils.concatenate3(this.m_returnType, " ", this.m_methodName);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(paramStr))
	{
		methodStr = oFF.XStringUtils.concatenate4(methodStr, "(", paramStr, ");");
	}
	else
	{
		methodStr = oFF.XStringUtils.concatenate2(methodStr, "();");
	}
	this.m_outputBuffer.appendLine("/**");
	this.m_outputBuffer.appendLine(javaDocDescStr);
	oFF.XCollectionUtils.forEach(this.m_paramJavaDocList, (tmpParamStr2) => {
		this.m_outputBuffer.appendLine(tmpParamStr2);
	});
	if (oFF.notNull(returnJavaDocStr))
	{
		this.m_outputBuffer.appendLine(returnJavaDocStr);
	}
	this.m_outputBuffer.appendLine(" */");
	if (generateLanguageHint)
	{
		this.m_outputBuffer.appendLine("@XLanguageHint(lang = TargetLanguage.OBJECTIVE_C, code = HintCode.SWIFT_NAME)");
	}
	this.m_outputBuffer.appendLine(methodStr);
	return this.m_outputBuffer.toString();
};
