	sourceCode.appendLine(" */");
	sourceCode.append("public interface ");
	sourceCode.append(oFF.UiAggregationHelper.getInterfaceName(aggr));
	sourceCode.appendLine(" extends IUiAggregation");
	sourceCode.appendLine("{");
