oFF.UiClientOperationQuasar.prototype.m_isSetter = false;
oFF.UiClientOperationQuasar.prototype._executeGetterOperation = function(client, uiContext, operation, offset)
{
	let uiReturnContext = null;
	if (oFF.notNull(uiContext))
	{
		let text = this.getValue(uiContext);
		if (oFF.notNull(text))
		{
			uiReturnContext = oFF.XStringValue.create(text);
		}
	}
	return uiReturnContext;
};
oFF.UiClientOperationQuasar.prototype._executeSetterOperation = function(client, uiContext, operation, offset)
{
	if (oFF.notNull(uiContext))
	{
		let paramText = null;
		if (offset < operation.size())
		{
			let element = operation.get(offset);
			if (oFF.notNull(element))
			{
				paramText = element.asString().getString();
			}
			this.setValue(uiContext, paramText);
		}
	}
	return uiContext;
};
oFF.UiClientOperationQuasar.prototype.executeOperation = function(client, uiContext, operation, offset)
{
	if (this.m_isSetter)
	{
		this._executeSetterOperation(client, uiContext, operation, offset);
		return uiContext;
	}
	return this._executeGetterOperation(client, uiContext, operation, offset);
};
oFF.UiClientOperationQuasar.prototype.isSetter = function()
{
	return this.m_isSetter;
};
