oFF.DfUiManagerGeneric.prototype.selectProviderComponents = function(operation, defaultDomain, contextObject, maximumCount)
{
	let components = oFF.XList.create();
	if (operation.getDomain() === oFF.SigSelDomain.UI || operation.getDomain() === oFF.SigSelDomain.CONTEXT)
	{
		let operationType = operation.getOperationType();
		if (operationType === oFF.SigSelType.MATCH_NAME)
		{
			let name = operation.getName();
			let element = oFF.XCollectionUtils.findFirst(this.m_uiElementRegistry.getValuesAsReadOnlyList(), (tmpContext) => {
				return oFF.XString.isEqual(tmpContext.getName(), name);
			});
			if (oFF.notNull(element))
			{
				components.add(element);
			}
		}
		else if (operationType === oFF.SigSelType.MATCH)
		{
			let selectedComponentType = operation.getSelectedComponentType();
			if (oFF.notNull(selectedComponentType))
			{
				let selectedElementsMap = this.m_uiElementsByType.getByKey(selectedComponentType.getName());
				if (oFF.notNull(selectedElementsMap))
				{
					let selectedElements = selectedElementsMap.getValuesAsReadOnlyList();
					let size = selectedElements.size();
					if (maximumCount !== -1 && size > maximumCount)
					{
						size = maximumCount;
					}
					for (let i = 0; i < size; i++)
					{
						components.add(selectedElements.get(i));
					}
				}
			}
		}
		else if (oFF.notNull(contextObject))
		{
			components.add(contextObject);
		}
	}
	return components;
};
