oFF.DfUiGeneric.prototype._addAssociationElementInternal = function(associationDef, element)
{
	this._validateAssociation(associationDef, oFF.UiCardinality.MANY);
	let elementId = null;
	if (oFF.notNull(element))
	{
		elementId = element.getId();
	}
	let associationList = this._getAssociationListCreateIfNeeded(associationDef);
	if (!associationList.contains(elementId))
	{
		associationList.add(elementId);
	}
	return this;
};
oFF.DfUiGeneric.prototype._canItemBeSelected = function(item)
{
	if (this.getUiType().supportsSelection())
	{
		let selectionAggregation = this.getUiType().getSelectionAggregation();
		if (oFF.notNull(selectionAggregation) && oFF.notNull(item))
		{
			if (selectionAggregation.getItemType() === null || selectionAggregation.getItemType().isEqualTo(item.getUiType()))
			{
				return true;
			}
		}
	}
	return false;
};
oFF.DfUiGeneric.prototype._checkIfChildCanBeAdded = function(child, aggrDef)
{
	if (oFF.notNull(child))
	{
		let myType = this.getUiType();
		let childType = child.getUiType();
		if (childType.isFloatingControl())
		{
			let errorMsg1 = oFF.XStringUtils.concatenate3("Control of type ", childType.getName(), " cannot have a parent, since it is a floating control. Do not attach it to a parent or use floatingControls section in a quasar document!");
			throw oFF.XException.createRuntimeException(errorMsg1);
		}
		if (childType === oFF.UiType.ROOT)
		{
			throw oFF.XException.createRuntimeException("UxRoot cannot be added as a child to a parent control. UxRoot should only be rendered at a native anchor id or native anchor object!");
		}
		if (oFF.notNull(aggrDef))
		{
			if (myType.hasAggregation(aggrDef) === false)
			{
				let errorMsg2 = oFF.XStringUtils.concatenate5("Control of type ", myType.getName(), " does not have the aggregation ", aggrDef.getName(), ".");
				throw oFF.XException.createRuntimeException(errorMsg2);
			}
		}
		if (myType.getAllowedItemType() !== null && aggrDef === oFF.UiAggregation.ITEMS)
		{
			if (childType.isTypeOf(myType.getAllowedItemType()) === false)
			{
				let errorMsg3 = oFF.XStringUtils.concatenate5("Control of type ", myType.getName(), " only accepts items of type ", myType.getAllowedItemType().getName(), ".");
				throw oFF.XException.createRuntimeException(errorMsg3);
			}
		}
	}
	else
	{
		throw oFF.XException.createRuntimeException("Cannot add 'null' as child to a parent. Something went wrong with child creation or 'null' was passed as a argument.");
	}
};
