oFF.DfUiGeneric.prototype._getSelectionAggregationAsReadOnlyList = function()
{
	if (this.getUiType().supportsSelection())
	{
		let selectionAggregation = this.getUiType().getSelectionAggregation();
		if (selectionAggregation === oFF.UiAggregation.TREE_TABLE_ROWS)
		{
			let treeTableRowList = oFF.XList.create();
			this.getTreeTableRowsRecursive(treeTableRowList);
			return oFF.XCollectionUtils.map(treeTableRowList, (context) => {
				return context;
			});
		}
		return this._getAggregation(selectionAggregation);
	}
	return null;
};
