oFF.DfUiGeneric.prototype._validateAggregation = function(aggrDef)
{
	this._ensureNotReleased();
	if (oFF.isNull(aggrDef))
	{
		throw oFF.XException.createRuntimeException("Missing aggregation definition. An aggregation needs to be specified!");
	}
};
oFF.DfUiGeneric.prototype._validateAssociation = function(associationDef, cardinality)
{
	this._ensureNotReleased();
	if (oFF.isNull(associationDef))
	{
		throw oFF.XException.createRuntimeException("Missing association definition. An association needs to be specified!");
	}
	if (oFF.notNull(cardinality) && associationDef.getCardinality() !== cardinality)
	{
		let errMsg = oFF.XStringUtils.concatenate4("Wrong association cardinality. Expected cardinality: ", cardinality.getName(), " Got: ", associationDef.getCardinality().getName());
		throw oFF.XException.createRuntimeException(errMsg);
	}
};
