oFF.DfUiGeneric.prototype.addElementToAggregation = function(element, aggrDef)
{
	if (oFF.notNull(element) && oFF.notNull(aggrDef))
	{
		let tmpAggregation = this._getAggregation(aggrDef);
		let theContext = element;
		this._checkIfChildCanBeAdded(theContext, aggrDef);
		if (tmpAggregation.contains(theContext) === false)
		{
			theContext.linkToParentAggregation(this, aggrDef);
			tmpAggregation.add(theContext);
			this._setAggregation(aggrDef, tmpAggregation);
		}
	}
};
