oFF.DfUiGeneric.prototype.clearAggregation = function(aggrDef)
{
	if (oFF.notNull(aggrDef))
	{
		let tmpAggregation = this._getAggregation(aggrDef);
		if (oFF.notNull(tmpAggregation))
		{
			let uiManager = this.getUiManager();
			uiManager.incCallLevel();
			if (uiManager.isExternalCall1())
			{
				let aggrIterator = tmpAggregation.getIterator();
				while (aggrIterator.hasNext())
				{
					let tmpEle = aggrIterator.next();
					tmpEle.unlinkFromParentAggregation();
				}
			}
			tmpAggregation.clear();
			this._setAggregation(aggrDef, tmpAggregation);
			if (uiManager.isExternalCall1())
			{
				if (this.getUiType().supportsSelection())
				{
					let selectionAgr = this.getUiType().getSelectionAggregation();
					if (selectionAgr === aggrDef)
					{
						this.clearSelectedItems();
					}
				}
			}
			uiManager.decCallLevel();
		}
	}
};
