oFF.DfUiGeneric.prototype.getSelectedItem = function()
{
	let tmpSelAggregationAsList = this._getSelectionAggregationAsReadOnlyList();
	if (oFF.notNull(tmpSelAggregationAsList))
	{
		for (let a = 0; a < tmpSelAggregationAsList.size(); a++)
		{
			let aggrItem = tmpSelAggregationAsList.get(a);
			if (oFF.notNull(aggrItem) && aggrItem.isSelected() === true)
			{
				return aggrItem;
			}
		}
	}
	return null;
};
