oFF.DfUiGeneric.prototype.getSelectedItems = function()
{
	let tmpSelAggregation = this._getSelectionAggregationAsReadOnlyList();
	let tmpSelectedItems = oFF.XList.create();
	if (oFF.notNull(tmpSelAggregation))
	{
		for (let a = 0; a < tmpSelAggregation.size(); a++)
		{
			let aggrItem = tmpSelAggregation.get(a);
			if (oFF.notNull(aggrItem) && aggrItem.isSelected() === true)
			{
				tmpSelectedItems.add(aggrItem);
			}
		}
	}
	return tmpSelectedItems;
};
