oFF.DfUiGeneric.prototype.getTreeTableRowsRecursive = function(rows)
{
	let topLevelItems = this.getTreeTableRows();
	rows.addAll(topLevelItems);
	for (let a = 0; a < topLevelItems.size(); a++)
	{
		let lowerItem = topLevelItems.get(a);
		lowerItem.getTreeTableRowsRecursive(rows);
	}
};
