oFF.DfUiGeneric.prototype.removeElementFromAggregation = function(element, aggrDef)
{
	if (oFF.notNull(element) && oFF.notNull(aggrDef))
	{
		let tmpAggregation = this._getAggregation(aggrDef);
		let uiManager = this.getUiManager();
		uiManager.incCallLevel();
		let oldItem = tmpAggregation.removeElement(element);
		if (uiManager.isExternalCall1())
		{
			oldItem.setSelected(false);
			oldItem.unlinkFromParentAggregation();
		}
		this._setAggregation(aggrDef, tmpAggregation);
		uiManager.decCallLevel();
	}
};
