oFF.DfUiGeneric.prototype.setSelectedItem = function(item)
{
	this._deselectAllItems();
	if (oFF.notNull(item) && this._canItemBeSelected(item))
	{
		let uiContextItem = item;
		uiContextItem.setSelected(true);
	}
	return this;
};
oFF.DfUiGeneric.prototype.setSelectedItemByIndex = function(index)
{
	this._deselectAllItems();
	let tmpSelAggregationAsList = this._getSelectionAggregationAsReadOnlyList();
	if (oFF.notNull(tmpSelAggregationAsList) && index < tmpSelAggregationAsList.size())
	{
		let aggrItem = tmpSelAggregationAsList.get(index);
		this.setSelectedItem(aggrItem);
	}
	return this;
};
oFF.DfUiGeneric.prototype.setSelectedItems = function(selectedItems)
{
	this._deselectAllItems();
	if (oFF.isNull(selectedItems))
	{
		return this;
	}
	for (let a = 0; a < selectedItems.size(); a++)
	{
		let selectedItem = selectedItems.get(a);
		if (oFF.notNull(selectedItem) && this._canItemBeSelected(selectedItem))
		{
			selectedItem.setSelected(true);
		}
	}
	return this;
};
oFF.DfUiGeneric.prototype.setSelectedName = function(selectedName)
{
	let tmpSelAggregationAsList = this._getSelectionAggregationAsReadOnlyList();
	if (oFF.notNull(tmpSelAggregationAsList) && oFF.notNull(selectedName))
	{
		for (let i = 0; i < tmpSelAggregationAsList.size(); i++)
		{
			let tmpElement = tmpSelAggregationAsList.get(i);
			let childName = tmpElement.getName();
			if (oFF.notNull(childName) && oFF.XString.isEqual(selectedName, childName))
			{
				this.setSelectedItem(tmpElement);
				return this;
			}
		}
	}
	return this;
};
