oFF.DfUiGeneric.prototype.updatePropertyValue = function(property, value)
{
	if (oFF.notNull(property) && oFF.notNull(value))
	{
		let valType = value.getValueType();
		if (valType === oFF.XValueType.INTEGER)
		{
			this._setIntegerPropertyValue(property, oFF.XConverterUtils.getInteger(value));
		}
		else if (valType === oFF.XValueType.BOOLEAN)
		{
			this._setBooleanPropertyValue(property, oFF.XConverterUtils.getBoolean(value));
		}
		else if (valType === oFF.XValueType.DOUBLE)
		{
			this._setDoublePropertyValue(property, oFF.XConverterUtils.getDouble(value));
		}
		else if (valType === oFF.XValueType.LONG)
		{
			this._setLongPropertyValue(property, oFF.XConverterUtils.getLong(value));
		}
		else if (valType === oFF.XValueType.STRING)
		{
			this._setStringPropertyValue(property, oFF.XConverterUtils.getString(value));
		}
		else
		{
			this._setObjectPropertyValue(property, value);
		}
	}
};
